import React from 'react';
import Navbar from '../../components/Navbar/Navbar';
import './About.css'

const About = () => {
    return (
        <div>
            <Navbar />
            <div className='text-color-white'>
                <p className='heading'>About</p>
                <p className='content'></p>
            </div>
        </div>
    )
}

export default About
